import './App.css';

function App() {
  const name = <h1>Zouena</h1>;
  const age = <h2> 20</h2>;
  const email = <h2>google@mail.com</h2>;
  const user = (
    <div>
      {name}
      {age}
      {email}
    </div>
  );
  return (
    <div className="App">
      {user}
      {user}
      {user}
    </div>)
}

export default App;
